descricao:
Aprovado com alteração, com a inclusão dos seguintes convidados:
1. Eduardo Nery, Diretor-Geral da ANTAQ;
2. Almirante Murillo Barbosa, Diretor-Presidente da ASSOCIAÇÃO DE TERMINAIS PORTUÁRIOS PRIVADOS - ATP;
3. Jesualdo Conceição da Silva, Diretor Presidente da Associação Brasileira dos Terminais Portuários - ABTP;
4. Sérgio Aquino, Presidente da Federação Nacional das Operações Portuárias (FENOP);
5. Instituto Brasileiro de Petróleo e Gás (IBP).
